import React, {Component} from 'react';
import PropTypes from 'prop-types';


class  PhotoItem extends Component {
    getStyle =() =>{
       return {
           background :'#f4f4f4',
           borderBottom : '1px #ccc dotted'
       }
    }


  render(){
    const{id,title,url,thumbnailUrl} = this.props.photo;
    return (
        <div>
           <p> 
           {id}
           
           <p style={{fontWeight:'bold',marginLeft:'10px'}}  >{title} </p>
           <img src={thumbnailUrl} alt="Logo"  onMouseOver={e => (e.currentTarget.src = url)}
            onMouseOut = {e => (e.currentTarget.src = thumbnailUrl)}/>;
         
           </p>
        </div>
    )
    
  }
 
}


//PropTypes
PhotoItem.propTypes ={
    photo: PropTypes.object.isRequired
   
}

const btnStyle={
    backgroundColor:'#ff0000',
    color:'#fff',
    border:'none',
    padding:'5px 9px',
    borderRadius:'50%',
    cursor:'pointer',
    float:'right'

}
const itemStyle={
    backgroundColor:'yellow'
}

export default PhotoItem;
